import React from "react";
import "./index.css"
import Home from "./routes/Home"
import Projects from "./routes/Projects"
import About from "./routes/About"

function App() {
  return (
    <>
    <Routes>
      <Route path = "/" element = {<Home />} />
      <Route path = "/" element = {<About />} />
      <Route path = "/" element = {<Projects />} />
    </Routes>
    </>
  );
}

export default App;
